  'AdminAdvparametersHelp' => 
  array (
    'This page benefits from increased performance and includes new features such as a new combination management system.' => 'Aceasta pagina are performante mai bune si include functii noi, cum ar fi un sistem nou de administrare a combinatiilor.',
    'Access the new product page, even in a multistore context. This is a work in progress and some features are not available.' => 'Acceseaza pagina de produs nou, chiar si intr-un context multi-magazin. Inca se lucreaza la ea, asa ca nu toate functiile sunt disponibile.',
    'This page benefits from increased performance and includes new features such as a new combination management system. Please note this is a work in progress and some features are not available yet.' => 'Aceasta pagina beneficiaza de performanta sporita si include functionalitati noi ca noul sistem de administrare a combinatiilor. Te rugam sa retii ca aceasta este o lucrare in desfasurare si unele functionalitati ar putea sa nu fie disponibile inca.',
