    'Warning, the current import may require a PHP setting update, to allow more data to be transferred. If the current import stops before the end, you should increase your PHP "post_max_size" setting to [1]%size%[/1]MB at least, and try again.' => 'Atentie, importul curent poate necesita o modificare a setarilor PHP pentru a permite transferul mai multor date. Daca importul curent se opreste inainte de completare, poti mari setarea "post_max_size" la [1]%size%[/1]MB, cel putin, si apoi poti incerca iar.',
