    'This will copy the images too. If you wish to proceed, click "%yes_label%". If not, click "%no_label%".' => 'Se vor copia si imaginile. Daca doresti sa continui, apasa "%yes_label%". Daca nu, apasa "%no_label%.',
    'You cannot update the available stock when it depends on stock.' => 'Nu poti actualiza stocul disponibil atunci cand depinde de stoc.',
