    'Invalid combination' => 'Combinatie invalida',
    'An error occurred during the image upload process.' => 'A aparut o eroare la incarcarea imaginii.',
    'An order has already been placed with this cart.' => 'A fost deja plasata o comanda cu acest cos.',
    'This product cannot be added to the cart.' => 'Acest produs nu poate fi adaugat in cos.',
