    'Invalid voucher.' => 'Cupon nevalid.',
    'There are not enough products in stock.' => 'Nu exista produse suficiente in stoc.',
    'Cannot add image because product creation failed.' => 'Nu se poate adauga imaginea deoarece crearea produsului a esuat.',
    'Error while creating additional image' => 'Eroare in timpul creearii imaginii aditionale',
    'Invalid quantity' => 'Cantitate incorecta',
