    'characters' => 'caractere',
    'How to calculate quantity discounts.' => 'Modul de calcul al reducerilor la cantitate.',
    'When active, friendly URL will be updated on every save.' => 'Daca aceasta setare este activa, adresele URL prietenoase vor fi actualizate la fiecare salvare.',
    'Enable this option if you want to activate by default all your manually created new products.' => 'Bifeaza aceasta optiune daca doresti ca toate produsele create manual sa fie active din start.',
    'If a customer meets multiple conditions, specific prices will be applied in this order of priority, unless a different order has been set for a particular product.' => 'Daca un client indeplineste mai multe conditii, preturile speciale vor fi aplicate in aceasta ordine, cu exceptia cazului in care pentru un anumit produs a fost creata o alta comanda.',
    'You can specify the default behavior for all disabled products. The product page can display a "Discontinued" message or an error page. You can also specify which HTTP response is sent to users. This can be set specifically for each product.' => 'Poti specifica comportamentul implicit pentru toate produsele inactive. Poate fi afisata pagina produsului cu mesajul „Indisponibil” sau pagina de eroare. De asemenea, poti specifica ce raspuns HTTP este trimis utilizatorilor. Acesta poate fi setat individual pentru fiecare produs.',
    'When enabled, friendly URL will be updated on every name change for offline products only.' => 'Cand este activata, adresa URL prietenoasa va fi actualizata la fiecare modificare a numelui, numai pentru produsele offline.',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Afiseaza butonul "%add_to_cart_label%" cand produsul are atribute',
    'Display or hide the "%add_to_cart_label%" button on category pages for products that have attributes forcing customers to see product details.' => 'Afiseaza sau ascunde butonul "%add_to_cart_label%" pe paginile categoriilor pentru produsele care au atribute, pentru a forta clientii sa vada detaliile produsului.',
    'In the volume discount table on the product page, display the discounted unit price instead of the unit discount. E.g. If you sell a product for $10 with a discount of $2 from 3 items purchased, the discounted unit price ($8) will be displayed instead of the unit discount ($2).' => 'In tabelul de reduceri la volum din pagina produsului, afiseaza pretul pe unitate redus in locul reducerii pe unitate. De exemplu, daca vinzi un produs de 10 lei pe unitate cu o reducere de 2 lei incepand de la 3 unitati achizitionate, va fi afisat pretul pe unitate redus (8 lei) in locul reducerii pe unitate (2 lei).',
    'Number of products displayed per page. Default is 12' => 'Numarul de produse afisate pe pagina. Implicit este 12',
    'The order in which products are displayed in the product list.' => 'Ordinea in care sunt afisate produsele in lista de produse',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Atunci cand vinzi pachete de produse, cum doresti sa fie calculat stocul?',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Daca un atribut nu este disponibil in fiecare combinatie de produse, acesta nu va fi afisat.',
    'Set to "0" to disable this feature.' => 'Seteaza 0 pentru a dezactiva aceasta caracteristica',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'In mod implicit, butonul "%add_to_cart_label%" este ascuns cand produsul este indisponibil. Poti decide sa fie afisat permanent.',
    'In stock' => 'In stoc',
