    'Out of stock' => 'Stoc epuizat',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Recomandat pentru conformarea cu legile UE (de ex.: livrare in 3-4 zile)',
    'Delivered within 3-4 days' => 'Livrare in 3-4 zile',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Recomandat pentru conformarea cu legile UE (de ex.: livrare in 5-7 zile)',
    'Delivered within 5-7 days' => 'Livrare in 5-7 zile',
    'Note that the label will be displayed only if backorders are denied.' => 'Retine ca eticheta va fi afisata numai daca comenzile pentru produse din stocul furnizorului sunt dezactivate.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Activeaza aceasta optiune daca vrei sa incluzi atributele produsului in meta title.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Activeaza aceasta optiune numai daca serverul tau permite rescrierea adreselor URL (ceea ce este recomandat).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Rescrierea de URL-uri (mod_rewrite) nu este activa pe server sau nu este posibila verificarea configurarii. Daca doresti sa folosesti URL-uri prietenoase trebuie sa ai activat acest mod.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Activeaza aceasta optiune daca doresti sa permiti folosirea diacriticelor in adresele URL prietenoase. Ar trebui sa o activezi numai daca utilizezi caractere non-latine; pentru toate seturile de caractere latine, evaluarea SEO va fi mai buna fara aceasta optiune.',
    'Enable this option only if you have problems with URL rewriting.' => 'Activeaza aceasta optiune doar daca ai probleme cu rescrierea de URL-uri pentru unele pagini.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Unele dintre functiile din PrestaShop ar putea sa nu functioneze corect cu anumita configuratie a modulului mod_security din Apache. Iti recomandam sa il dezactivati.',
