    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'Pentru a adauga etichete, clicaie in casuta, scrie numele etichetei si apoi apasa tasta "Enter".',
    'Invalid characters:' => 'Caractere nepermise:',
    'Name of the related page.' => 'Numele paginii inrudite.',
