    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Poti muta magazinul doar intr-un grup cu toate optiunile de partajare dezactivate sau intr-un grup fara clienti/comenzi.',
    'For security reasons, you cannot delete default order statuses.' => 'Din motive de securitate, nu se pot sterge stadiile implicite ale comenzilor.',
