  'ModulesStatsregistrationsAdmin' => 
  array (
    'Customer accounts' => 'Conturi de clienti',
    'Adds a registration progress tab to the Stats dashboard.' => 'Adauga un tab ce contine progresul inregistrarilor la panoul de Statistici.',
    'Number of visitors who stopped at the registering step:' => 'Numarul de vizitatori care s-au oprit la pasul de inregistrare:',
