    'How to remove the personal data of a customer?' => 'Cum se pot sterge datele personale ale unui client?',
    'If the request is valid, from the Personal Data Management tab of this module, any customer can be found by typing the first few letters of his name or email address in the search bar.
Before deleting any data, we recommend you to download all the invoices of the involved customer. After deleting the data with the “Remove data” button, the customer’s orders can’t be legally deleted, they just won’t be linked to any account. This allows you to keep precise statistics of your shop.' => 'Daca solicitarea este valida, din fila \'Gestionarea datelor cu caracter personal\' a acestui modul, orice client poate fi gasit tastand primele litere ale numelui sau adresei sale de e-mail in bara de cautare.
Inainte de a sterge orice date, iti recomandam sa descarci toate facturile clientului implicat. Legea nu permite stergerea comenzilor clientilor. Pur si simplu, dupa stergerea datelor cu butonul „Sterge datele”, aceste comenzi nu vor fi conectate la niciun cont. Descarcarea facturilor iti permite sa pastrezi statistici precise pentru magazinul tau',
